-- hospital_db 데이터베이스 구조 내보내기
CREATE DATABASE IF NOT EXISTS `hospital_db` /*!40100 DEFAULT CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci */;
USE `hospital_db`;

-- 테이블 hospital_db.hospital_detail 구조 내보내기
CREATE TABLE IF NOT EXISTS `hospital_detail` (
  `hospital_code` varchar(255) NOT NULL,
  `parking_capacity` double DEFAULT NULL,
  `emergency_service` text DEFAULT NULL,
  `weekday_lunch` text DEFAULT NULL,
  `weekday_reception` text DEFAULT NULL,
  `saturday_reception` text DEFAULT NULL,
  `night_emergency_available` text DEFAULT NULL,
  `mon_open` int(11) DEFAULT NULL,
  `tues_open` int(11) DEFAULT NULL,
  `wed_open` int(11) DEFAULT NULL,
  `thurs_open` int(11) DEFAULT NULL,
  `fri_open` int(11) DEFAULT NULL,
  `mon_end` int(11) DEFAULT NULL,
  `tues_end` int(11) DEFAULT NULL,
  `wed_end` int(11) DEFAULT NULL,
  `thurs_end` int(11) DEFAULT NULL,
  `fri_end` int(11) DEFAULT NULL,
  KEY `idx_hospital_code` (`hospital_code`),
  CONSTRAINT `fk_hospital_detail_hospital_code` FOREIGN KEY (`hospital_code`) REFERENCES `hospital_main` (`hospital_code`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB ROW_FORMAT=DYNAMIC DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

-- 테이블 데이터 hospital_db.hospital_detail:~1,883 rows (대략적) 내보내기

-- 테이블 hospital_db.hospital_main 구조 내보내기
CREATE TABLE IF NOT EXISTS `hospital_main` (
  `hospital_code` varchar(255) NOT NULL,
  `hospital_name` text DEFAULT NULL,
  `province_name` text DEFAULT NULL,
  `district_name` text DEFAULT NULL,
  `hospital_address` text DEFAULT NULL,
  `hospital_tel` text DEFAULT NULL,
  `hospital_homepage` text DEFAULT NULL,
  `doctor_num` bigint(20) DEFAULT NULL,
  `coordinate_x` double DEFAULT NULL,
  `coordinate_y` double DEFAULT NULL,
  `emergency_available` text DEFAULT NULL,
  `park_available` int(11) DEFAULT NULL,
  `pro_doc` int(11) DEFAULT NULL,
  `end_time` int(11) DEFAULT NULL,
  PRIMARY KEY (`hospital_code`),
  KEY `idx_hospital_code` (`hospital_code`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

-- 테이블 데이터 hospital_db.hospital_main:~1,863 rows (대략적) 내보내기

-- 테이블 hospital_db.hospital_medical_subject 구조 내보내기
CREATE TABLE IF NOT EXISTS `hospital_medical_subject` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `hospital_code` varchar(255) DEFAULT NULL,
  `subject_name` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `hospital_code` (`hospital_code`),
  CONSTRAINT `hospital_medical_subject_ibfk_1` FOREIGN KEY (`hospital_code`) REFERENCES `hospital_main` (`hospital_code`)
) ENGINE=InnoDB AUTO_INCREMENT=4425 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

